import React from 'react';

const Players = () => {
    const hockeyPlayers = [
        {
            name: 'Nav Dhamrait',
            age: 29,
            shootHand: 'Left',
            imageUrl:
                'https://media.licdn.com/dms/image/C4D03AQEQSPPTVT6-Ow/profile-displayphoto-shrink_800_800/0/1519322311787?e=2147483647&v=beta&t=YRq4ElvYhYH4kkpoVq30aGJDYlOHMqU60xHjDXHwdY0',
        },
        {
            name: 'Gurveer Gill',
            age: 29,
            shootHand: 'Left',
            imageUrl:
                'https://media.licdn.com/dms/image/C4D03AQEQSPPTVT6-Ow/profile-displayphoto-shrink_800_800/0/1519322311787?e=2147483647&v=beta&t=YRq4ElvYhYH4kkpoVq30aGJDYlOHMqU60xHjDXHwdY0',
        },
        {
            name: 'Varinder Gill',
            age: 40,
            shootHand: 'Left',
            imageUrl:
                'https://media.licdn.com/dms/image/C4D03AQEQSPPTVT6-Ow/profile-displayphoto-shrink_800_800/0/1519322311787?e=2147483647&v=beta&t=YRq4ElvYhYH4kkpoVq30aGJDYlOHMqU60xHjDXHwdY0',
        },
        {
            name: 'Andy Badwal',
            age: 43,
            shootHand: 'Right',
            imageUrl:
                'https://media.licdn.com/dms/image/C4D03AQEQSPPTVT6-Ow/profile-displayphoto-shrink_800_800/0/1519322311787?e=2147483647&v=beta&t=YRq4ElvYhYH4kkpoVq30aGJDYlOHMqU60xHjDXHwdY0',
        },
        {
            name: 'Suhky Dhami',
            age: 31,
            shootHand: 'Right',
            imageUrl:
                'https://media.licdn.com/dms/image/C4D03AQEQSPPTVT6-Ow/profile-displayphoto-shrink_800_800/0/1519322311787?e=2147483647&v=beta&t=YRq4ElvYhYH4kkpoVq30aGJDYlOHMqU60xHjDXHwdY0',
        },
    ];

    return (
        <div style={{ margin: '20px' }}>
            <h1>FNL Players</h1>
            <div style={{ display: 'flex', flexWrap: 'wrap' }}>
                {hockeyPlayers.map((player, index) => (
                    <div
                        key={index}
                        style={{
                            border: '1px solid black',
                            borderRadius: '5px',
                            margin: '10px',
                            padding: '10px',
                            width: '200px',
                        }}
                    >
                        <img src={player.imageUrl} alt={player.name} style={{ width: '100%' }} />
                        <h3>{player.name}</h3>
                        <p>Age: {player.age}</p>
                        <p>Shoot Hand: {player.shootHand}</p>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Players;
